// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import WelcomePage from './components/WelcomePage';
import WelcomePage2 from './components/WelcomePage2';
import WelcomePage3 from './components/WelcomePage3';
import WelcomePage4 from './components/WelcomePage4';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" exact component={WelcomePage} />
        <Route path="/welcome2" component={WelcomePage2} />
        <Route path="/welcome3" component={WelcomePage3} />
        <Route path="/welcome4" component={WelcomePage4} />
      </Routes>
    </Router>
  );
};

export default App;
